import React from "react";

function TeacherCard({ teacher }) {
  const { name, bio } = teacher;
  return (
    <div>
      <h4>{name}</h4>
      <p>{bio}</p>
      <button
        className="px-4 py-1 bg-red-400"
        onClick={() => console.log(teacher.id)}
      >
        Delete Teacher
      </button>
    </div>
  );
}

export default TeacherCard;
